function readData(jsonData)
{
  var ret;
  for(let data in jsonData)
  {
    if(typeof(jsonData[data])=="object" || typeof(jsonData[data])=="array")
      ret+=readData(jsonData[data])+"<br />";
    else
      ret+=jsonData[data]+"<br />";
  }
  return ret;
}
export default readData;
